import "./notification.css"

const Notification = ({message, msgColor}) => {
    let notifColor
    let borderColor
    console.log(message)
    if (msgColor) {
        notifColor = msgColor;
        borderColor = msgColor;
    } else {
        notifColor = '#FFFFFF';
        borderColor = '#03DAC5'
    }
    const vw = window.innerWidth;
    let left;
    if (vw > 600) {
        left = '60%';
    } else {
        left = '50%';
    }
    return(
        <div style={{
            color: notifColor,
            borderColor: borderColor,
            left: {left}
        }} className="notification">{message}</div>
    )
}

export default Notification;
